import React from 'react'
import Layout from '../components/layout'
import { Header, Label, Icon } from 'semantic-ui-react'

function calendar() {
  return (
    <Layout
      left=<Label>
    <Icon name='mail' /> 23
  </Label>
      right={<p>Some right content here...</p>}
    >
      <Header>Hello World</Header>
    </Layout>
  )
}

export default calendar
